import React from "react";

function Modal ({closeModel}) {
    return(
        <>
            <div className='modalbg'>
                <div className='modelContainer'>
                    <button onClick={() => closeModel(false)}> X </button>
                    <div className='body'>
                        <h1>expander</h1>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Modal;
